INSERT INTO `v1_9508a22f7f4bccf930cec5156fad925268c056c4f847141aa3a920ae15e8f199` VALUES (1, 3, "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", 1, "スタンダードコレクション");
INSERT INTO `v1_9508a22f7f4bccf930cec5156fad925268c056c4f847141aa3a920ae15e8f199` VALUES (1, 10, "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 2, "プレミアムコレクション");
INSERT INTO `v1_9508a22f7f4bccf930cec5156fad925268c056c4f847141aa3a920ae15e8f199` VALUES (1, 3, "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", 3, "フェスコレクション");
